import "./Mainselect.css";
import data from "./Data3";
import { useState } from "react";
function Selitem(props) {
  const [one, changeone] = useState(1);
  const nextimg = () => {
    changeone(one + 1);
  };
  data.properties.map((index) => {
    if (props.index === index.index) {
      changeone(index._id);
    }
  });
  return (
    <div className="class2">
      <div className="angle">
        <div className="angle1" onclick={nextimg}>
          <img
            className="angle2"
            src={data.properties[one - 2].picture}
            alt="Loading..."
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one - 1].picture}
            alt="Loading..."
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one].picture}
            alt="Loading..."
          />
        </div>
      </div>
      <div className="mainitem"></div>
      <div className="descrp"></div>
    </div>
  );
}
export default Selitem;
